import React, { useState } from 'react';
import Eac1 from './eac1.png';
import bac1 from './bac1.png';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/esm/Row';
import Col from 'react-bootstrap/esm/Col';
import Card from 'react-bootstrap/Card';
import  Button  from 'react-bootstrap/Button';

const MyForm = () => {
  // Define state variables for form fields
  const [formData, setFormData] = useState({
    FirstName: "",
    LastName:"",
    Email: "",
    Phone: "",
    Address:""
  });

  // Handle form field changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // Do something with the form data (e.g., send it to a server)
    console.log('Form data submitted:', formData);
  };

  return (
  <div id="contact" className='' >
     <Image src={bac1}width={'100%'} height={100}/>
     
      <Row className='bg-white pb-5 ps-2'>
      <Col >
        <Image src={Eac1} width={'100%'} height={450} />
      </Col>
      <Col className='bg-white pe-4 '>
        <Card  className='pt-2 pb-2'>
    <form onSubmit={handleSubmit}>
      <label className='pt-3'>
         FirstName:
        <input
          type="text"
          name="FirstName"
          value={formData.Name}
          onChange={handleChange}
        />
      </label>
      <label className='pt-3'>
         LastName:
        <input
          type="text"
          name="LastName"
          value={formData.Name}
          onChange={handleChange}
        />
      </label>
      <br />

      <label className='pt-3'>
        Phone:
        <input
          type="text"
          name="Phone"
          value={formData.Phone}
          onChange={handleChange}
        />
      </label>
      <br />

      <label className='pt-3'>
        Email:
        <input
          type="email"
          name="Email"
          value={formData.Email}
          onChange={handleChange}
        />
      </label>
      <br />
      <label className='pt-3 pb-3'>
        Address:
        <input
          type="text"
          name="Address"
          value={formData.Address}
          onChange={handleChange}
        />
      </label>
      <br />
      <Button variant='primary' type="submit" >Submit</Button>
    </form>
    </Card>
    </Col>
    </Row>
    </div>
  );
};

export default MyForm;
